_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "AP_Avoidance takes data from two mavlink sources: GLOBAL_POSITION_INT and\
    \ ADSB_VEHICLE. However, in the avoidance library both will being labeled as coming\
    \ from ADSB. \r\n\r\nThis should pretty much have no effect but should be implemented\
    \ correctly just in case. Since [the only place that checks it](https://github.com/ArduPilot/ardupilot/blob/master/libraries/AP_Avoidance/AP_Avoidance.cpp#L205)\
    \ also checks the src ID which is an apples vs oranges check (mavlink sys ID vs\
    \ 24bit ICAO) those will never match unless you're intentionally broadcasting/using\
    \ an invalid ICAO.\r\n\r\nHowever, this may effect users who are using the ADSB_VEHICLE\
    \ packet for avoidance without using ADSB hardware, just using it as a packet\
    \ to utilize the avoidance library and may indeed be using illegal ICAO numbers\
    \ because they didn't know it auto-magically works with GLOBAL_POSITION_INT."
